const MenuBtn = ({className}) => {
    className = 'fas fa-bars dropdown-toggle '+ className
    return (
        <a href="#">
           <i id="navbarDropdownMenuLink" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false" className={className}></i>
        </a>
    )
}

export default MenuBtn
